detaileddescription.para:
User registration is controled by LinphoneProxyConfig settings.
 Each LinphoneProxyConfig object can be configured with registration informations like proxy address  , user id , refresh period , and so on. 
 A created proxy config using linphone_proxy_config_new(), once configured, must be added to LinphoneCore using function linphone_core_add_proxy_config(). 
 It is recommended to set a default proxy config  using function linphone_core_set_default_proxy(). Once done, if a proxy config  has been configured with attribute enable register  , next call to linphone_core_iterate() triggers a SIP register. 
 Registration status is reported by LinphoneCoreRegistrationStateChangedCb. 

 This pseudo code demonstrates basic registration operations: 
LinphoneProxyConfig*proxy_cfg;
/*createproxyconfig*/
proxy_cfg=linphone_proxy_config_new();
/*parseidentity*/
LinphoneAddress*from=linphone_address_new("sip:toto@sip.titi.com");
LinphoneAuthInfo*info;
if(password!=NULL){
info=linphone_auth_info_new(linphone_address_get_username(from),NULL,"secret",NULL,NULL);/*createauthenticationstructurefromidentity*/
linphone_core_add_auth_info(lc,info);/*addauthenticationinfotoLinphoneCore*/
}
//configureproxyentries
linphone_proxy_config_set_identity(proxy_cfg,identity);/*setidentitywithusernameanddomain*/
constchar*server_addr=linphone_address_get_domain(from);/*extractdomainaddressfromidentity*/
linphone_proxy_config_set_server_addr(proxy_cfg,server_addr);/*weassumedomain=proxyserveraddress*/
linphone_proxy_config_enable_register(proxy_cfg,TRUE);/*activateregistrationforthisproxyconfig*/
linphone_address_destroy(from);/*releaseresource*/

linphone_core_add_proxy_config(lc,proxy_cfg);/*addproxyconfigtolinphonecore*/
linphone_core_set_default_proxy(lc,proxy_cfg);/*settodefaultproxy*/

 Registration sate call back: staticvoidregistration_state_changed(struct_LinphoneCore*lc,LinphoneProxyConfig*cfg,LinphoneRegistrationStatecstate,constchar*message){
printf("Newregistrationstate%sforuserid[%s]atproxy[%s]\n"
,linphone_registration_state_to_string(cstate)
,linphone_proxy_config_get_identity(cfg)
,linphone_proxy_config_get_addr(cfg));
}

Authentication: 
Most of the time, registration requires authentication to succeed. LinphoneAuthInfo info must be either added to LinphoneCore using function linphone_core_add_auth_info() before LinphoneProxyConfig is added to Linphone core, or on demand from call back LinphoneCoreAuthInfoRequestedCb. 

Unregistration: 
 Unregistration or any changes to LinphoneProxyConfig must be first started by a call to function linphone_proxy_config_edit() and validated by function linphone_proxy_config_done() 
 This pseudo code shows how to unregister a user associated to a LinphoneProxyConfig LinphoneProxyConfig*proxy_cfg;
linphone_core_get_default_proxy(lc,&proxy_cfg);/*getdefaultproxyconfig*/
linphone_proxy_config_edit(proxy_cfg);/*starteditingproxyconfiguration*/
linphone_proxy_config_enable_register(proxy_cfg,FALSE);/*de-activateregistrationforthisproxyconfig*/
linphone_proxy_config_done(proxy_cfg);/*initiateREGISTERwithexpire=0*/

 A complete tutorial can be found at : Registration tutorial
